    console.log(users.length)
    useEffect(() => {
        fetch('/about')
            .then(res => res.json())
            .then(async(data) =>{
                // await console.log(users)
                // await console.log(data)
                await setUser(data)
                // await console.log(users.length)
                // setShow(true)
            } )
    }, []);

